import React from "react";

function Expenses(expenses) {
  return (
    <div className="expenses">
      {expenses.map((expense, index) => {
        return (
            <div key={index}>
                {expense.name}
                {expense.date}
                {expense.amount}
            </div>
        )
      })}
    </div>
  );
}

export default Expenses;
